/** @format */

import React from "react";

const App = () => {
	return (
		<div style={{ background: "red", minHeight: "82vh", marginTop: "3px" }}>
			<iframe width="425" height="350" frameborder="0" scrolling="no" marginheight="0" marginwidth="0" src="https://www.openstreetmap.org/export/embed.html?bbox=-38.67187500000001%2C-49.037867945326425%2C81.03515625000001%2C43.70759350405296&amp;layer=cyclemap" style="border: 1px solid black"></iframe><br/><small><a href="https://www.openstreetmap.org/#map=3/-3.86/21.18&amp;layers=C">View Larger Map</a></small>
		</div>
	);
};

export default App;
